import React, {useEffect} from "react";
import {Link} from "react-router-dom";
import AlgorithmScreen from "./AlgorithmScreen";
import BrowserRouter from "react-router-dom/modules/BrowserRouter";

function ArrayMainScreen(props) {

    useEffect( () => {

        //
        return () => {
            //
        };
    })
    return (
        <div className="test">
           <p>You are in the main of Array searching!</p>
            <BrowserRouter>
            <ul>
                <li>
                    <Link to={AlgorithmScreen}>Sequential Search</Link>
                </li>
                <li>
                    <a href="#">Binary Search</a>
                </li>
                <li>
                    <a href="#">Quick sort</a>
                </li>
                <li>
                    <a href="#">Fibonacci Search</a>
                </li>
                <li>
                    <a href="#">Block Search</a>
                </li>
                <li>
                    <a href="#">Interpolation Search</a>
                </li>
                <li>
                    <a href="#">Algorithm#2</a>
                </li>
            </ul>
            </BrowserRouter>
        </div>
    )
};

export default ArrayMainScreen;
